import React from 'react';
import Grid from '@mui/material/Grid';
import { Box, Container } from '@mui/material';
import ResponsiveAppBar from './appBar/navbar'
import SignIn_form from './signIn_form/signIn'
import JoinNow from './Join_now_page/joinNowForm'
import { Route, Link, Routes } from 'react-router-dom'
import styled from 'styled-components'

const GlassDiv = styled.div`
  position: absolute;
  top : 0;
  left : 0;
  z-index : 2;
  width : 97.7%;
  height : 95%;
  padding : 20px;
  background : rgba(240,240,240,0.4);
  backdrop-filter : blur(6px);
`


export default function Home() {

const [joinNowBtnTrigger, setJoinNowBtnTrigger] = React.useState(false)

React.useEffect(() => {

},[joinNowBtnTrigger])


    const JoinNowCallBack = () => {
        setJoinNowBtnTrigger(true)
    }


    return (
        <>
        {joinNowBtnTrigger? <GlassDiv/> : null}
            <Container maxWidth="xl" sx={{ pt: '10px' }}>
                <Box sx={{ width: '80%', mx: 'auto', flexGrow: 1 }}>
                    <Grid container spacing={1}>
                        <Grid item xs={12} md={12}>
                            <ResponsiveAppBar JoinNowCallBack = {JoinNowCallBack} />
                        </Grid>
                        <Grid item xs={12} md={12}>
                            <SignIn_form  />
                            <Routes>
                                <Route path="/joinNow" element={<JoinNow />} />
                            </Routes>
                        </Grid>
                    </Grid>
                </Box>
            </Container>
        </>
    );
}
